import React from "react";


const Contato = () => {
  return (
    <main>
      <address>
        <div className="contact">
          <i className="fab fa-whatsapp"></i>
          <p>Tel: 21 99999-9999</p>
        </div>
        <div className="contact">
          <i className="fas fa-at"></i>
          <p>contato@eds.com.br</p>
        </div>
      </address>

    </main>
  );
};

export default Contato;
